
---
# Ansible Group Variables for Local AI Packaged K3s Deployment
# Variables for all hosts. Secrets will be generated dynamically in playbook.

# General
ansible_python_interpreter: /usr/bin/python3
project_dir: /opt/local-ai-packaged
repo_url: https://github.com/coleam00/local-ai-packaged.git
k3s_version: v1.29.6+k3s1  # Lightweight K8s for single-node
docker_version: 26.1.4
kompose_version: v1.34.0  # For converting Compose to K8s manifests

# K3s Configuration
k3s_token: "{{ k3s_token | default('auto-generate') }}"  # Generated in playbook
k3s_cluster_cidr: 10.42.0.0/16
k3s_service_cidr: 10.43.0.0/16
k3s_flannel_ifname: eth0  # Adjust if needed for server NIC
node_ports_range: "30000-32767"  # K8s NodePort range for dynamic ports

# Base Ports from docker-compose.yml (for conflict resolution)
base_ports:
  n8n: 5678
  ollama: 11434
  qdrant: 6333
  neo4j: 7474
  frontend: 3000
  supabase: 8000
  flowise: 3001
  open_webui: 8080
  langfuse: 3000
  searxng: 8080
  caddy: 80
  caddy_https: 443
  rabbitmq: 15672
  graylog: 9000

# Environment Variables from .env.example (placeholders; generate real values in playbook)
env_vars:
  NODE_ENV: development
  PORT: 3000
  NEXT_PUBLIC_SUPABASE_URL: "http://localhost:8000"
